import React from 'react';
import sketingImg from '../sketing.jpg';
import paintingImg from '../painting.jpg';
import travelingImg from '../traveling.jpg';

const hobbies = [
  {
    img: sketingImg,
    title: 'Skating',
    desc: 'I love skating for fun and fitness. It helps me stay active and enjoy the outdoors.',
  },
  {
    img: paintingImg,
    title: 'Painting',
    desc: 'Painting allows me to express my creativity and relax after a busy day.',
  },
  {
    img: travelingImg,
    title: 'Traveling',
    desc: 'Traveling gives me the opportunity to explore new places and cultures.',
  },
];

function Hobbies() {
  return (
    <section className="hobbies">
      <h2>Hobbies</h2>
      <div className="hobby-list">
        {hobbies.map((hobby) => (
          <div className="hobby-card" key={hobby.title}>
            <img src={hobby.img} alt={hobby.title} className="hobby-img" />
            <h3>{hobby.title}</h3>
            <p>{hobby.desc}</p>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Hobbies;
